import React from "react";
import "./NavBar.css";

const NavBar = () => {
  return (
    <ul className="navbar">
      <li>
        <a>Home</a>
      </li>
      <li>
        <a>Leagues</a>
      </li>
      <li>
        <a>Scorers</a>
      </li>

      <li>
        <a>Sign up</a>
      </li>
    </ul>
  );
};

export default NavBar;
